    dataIndex: 'id',
  },
  {
    title: 'Molde',
    dataIndex: 'molde',
  },
];
const data = [
  {
    key: '1',
    id: '1',
    molde: '21345'

  },
  {
    key: '2',
    id: '2',
    molde: '1245'
   
  },

];
